import React from 'react';
import styled from 'styled-components';

const Header = styled.div`
  width: 100vw;
  height: 80px;
  box-shadow: 0 5px 1px black;
`;
const HeaderBlock = () => {
  return <Header>헤더</Header>;
};

export default HeaderBlock;
